        "title": "GoPro HERO4: The Adventure of Life in 4K",
        "description": "All around the world GoPro users are capturing incredible experiences, from the heart-stopping to the heartfelt. Into the caldron of an active volcano, the neon streets of Japan, a refuge for wild mustangs, scaling an iceberg, the world‚Äôs biggest dance party, or a whale rescue mission, GoPros have documented every moment. See how GoPro‚Äôs new line of our most advanced cameras ever allow you to beautifully and authentically capture and share the experiences that bring purpose, adventure, and joy to your life.\n¬†\nShot 100% on the new GoPro HERO4 camera from¬†http://GoPro.com.\n#GoPro¬†¬†\n\nThe HERO4 features ultra high resolution quality of 4K at 30 frames per second + high frames rates at 1080p120. Incredible low light capabilities, including our new nightlapse setting. 2X the high fidelity sound. Faster processing. Protune settings that unlock manual control of many of your GoPro‚Äôs features, and so much more. Learn more and be inspired by the most advanced GoPro cameras yet:¬†http://GoPro.com\n\nIt‚Äôs your life. BE A HERO.¬†\n\nMUSIC\n\"Run Boy Run\" performed by Woodkid\nCourtesy of Interscope Records under license from Universal Music Enterprises \n\nFEATURED CHARACTERS \n\nTOMORROWLAND (Boom, Belgium)\nErin Edenholm\nJoanna Piotrowska\nSteve Aoki\nKrewella - Jahan Yousaf and Jasmine Yousaf\nDimitri Vegas\nLike Mike\n\nLAVA LAKE (Ambrym Island, Vanuatu)\nGeoff Mackley\nBrad Ambrose\n\nICEBERG CLIMB (Ilulissat, Greenland)\nKlemen Premrl\nAljaz Anderle\nThierry Dubois\n\nWILD MUSTANGS (Wells, Nevada)\nClay Nannini\n\nJAPAN STREETS (Tokyo, Japan)\nAkira Nakai\nShinichi Moroboshi\nNanami Tsukamoto\n\nORCA RESCUE (Whangarei, New Zealand)\nDr. Ingrid Visser\nTerry Hardie\nDian and her two baby orca\n\n\nSPECIAL THANKS\nTomorrowland (http://www.tomorrowland.com)\nMichael Dujardin\nVanuatu Heli (http://www.vanuatuhelicopters.com)\nAndy Martin\nBlack Diamond (http://www.blackdiamondequipment.com)\nMadeline Pickens (http://mustangmonument.co